if myHero.charName ~= "Kalista" then return end

_G.Kalista_Autoupdate = true

---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
local lib_Required = {
	["Prodiction"]	= "https://bitbucket.org/Klokje/public-klokjes-bol-scripts/raw/1f9cb1f9cc9792ed682e5e51adeb4432a40c3b5d/Test/Prodiction/Prodiction.lua",
	["SxOrbWalk"]	= "https://raw.githubusercontent.com/Superx321/BoL/master/common/SxOrbWalk.lua",
	["VPrediction"]	= "https://raw.githubusercontent.com/Hellsing/BoL/master/common/VPrediction.lua",
}

local lib_downloadNeeded, lib_downloadCount = false, 0

function AfterDownload()
	lib_downloadCount = lib_downloadCount - 1
	if lib_downloadCount == 0 then
		lib_downloadNeeded = false
		print("<font color=\"#4c934c\">Kalista:</font> <font color=\"#FFFFFF\">Required libraries downloaded successfully, please reload (double F9).</font>")
	end
end


if _G.Reborn_Loaded or _G.AutoCarry or _G.MMA_Loaded then
	lib_Required["SxOrbWalk"] = nil
end
	
for lib_downloadName, lib_downloadUrl in pairs(lib_Required) do
	local lib_fileName = LIB_PATH .. lib_downloadName .. ".lua"

	if FileExist(lib_fileName) then
		require(lib_downloadName)
	else
		lib_downloadNeeded = true
		lib_downloadCount = lib_downloadCount and lib_downloadCount + 1 or 1
		print("<font color=\"#4c934c\">Kalista:</font> <font color=\"#FFFFFF\">Downloading required: "..lib_downloadName..". Please reload(double F9) in 30 seconds if nothing happens and try again.</font>")
		DownloadFile(lib_downloadUrl, lib_fileName, function() AfterDownload() end)
	end
end

if lib_downloadNeeded then return end

local script_downloadName = "Kalista"
local script_downloadHost = "raw.github.com"
local script_downloadPath = "/Ralphlol/BoLGit/master/Kalista.lua" .. "?rand=" .. math.random(1, 10000)
local script_downloadUrl = "https://" .. script_downloadHost .. script_downloadPath
local script_filePath = SCRIPT_PATH .. GetCurrentEnv().FILE_NAME

function script_Messager(message) print("<font color=\"#4c934c\"><b>" .. script_downloadName .. ":</font> </b><font color=\"#FFFFFF\">" .. message) end

if _G.Kalista_Autoupdate then
	local script_webResult = GetWebResult(script_downloadHost, script_downloadPath)
	if script_webResult then
		local script_serverVersion = string.match(script_webResult, "%s*_G.Kalista_Version%s+=%s+%d+%.%d+")

		if script_serverVersion then
			script_serverVersion = tonumber(string.match(script_serverVersion or "", "%d+%.?%d*"))

			if not script_serverVersion then
				script_Messager("Please contact the developer of the script \"" .. script_downloadName .. "\", since the auto updater returned an invalid version.")
				return
			end

			if _G.Kalista_Version < script_serverVersion then
				script_Messager("New version available: " .. script_serverVersion)
				script_Messager("Updating, please don't press F9")
				DelayAction(function () DownloadFile(script_downloadUrl, script_filePath, function() script_Messager("Successfully updated the script, please reload and check the changelog!") end) end, 2)
			else
				script_Messager("You've got the latest version: " .. script_serverVersion)
				--DelayAction(function()
					--PopUpS("Version 0.99 Loaded", "Kalista")
				--end, 3)
			end
		else
			script_Messager("Something went wrong, update the script manually!")
		end
	else
		script_Messager("Error downloading server version!")
	end
end

assert(load(Base64Decode(""), nil, "bt", _ENV))()